import { GlobalContext, GlobalProvider } from '../context/GlobarState';

export const TransactionList = () => {
    const {transactions} = useContext(GlobalContext);
    // console.log(context);
    return (
        <div>
            <h3>History</h3>
            <ul className="list">
                {transactions.map(transaction =>  (<li className="minus">
                {transactions.text} <span>-$400</span><button className="delete-btn">x</button>
                </li>))}

            </ul>
        </div>
    )
}
